    this.myArray = [];
   }

  searchName() {
  return this.http.post("https://api.igdb.com/v4/games", JSON.stringify("fields *; limit 5;"), {
    headers: {
      "Accept": "application/json",
      "Client-Id": "5f1u1qxbs3hq9qk1nmi9v57onkwagv",
      "Authorization": "Bearer s5zmjs29jfon2to24upkq2t4cobmr2"
    }
  });
  }

